import React from 'react';
import './ColorPicker.css'

function GameTypes({ changeColorPicker }) {
  return (
    <div className='containerColorPicker'>
        <div className='colorbutton'>
            <button class="button-35" role="button" value="white" onClick={(e)=>changeColorPicker(e)}>white</button>
        </div>
        <div className='colorbutton'>
            <button class="button-35" role="button" value="black" onClick={(e)=>changeColorPicker(e)}>black</button>
        </div>
        <div className='colorbutton'>
            <button class="button-35" role="button" value="cumulative" onClick={(e)=>changeColorPicker(e)}>cumulative</button>
        </div>
    </div>
  )
}

export default GameTypes;
